script: |
  super -f text -I q9130.spq | sort > q9130.out

inputs:
  - name: q9130.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + + 0 / 9 * - + col1 * - col1 NOT BETWEEN + + 50 + - col1 AND col2 * - col0;
  - name: tab1

outputs:
  - name: q9130.out
    data: |
      51	14	96
      85	5	59
      91	47	68
